import React, { useState } from 'react';

const setUserIngredient = () => {

    const [ingredientList, setIngredientList] = useState([]);

    const createUserList = (e) => {
        const ing = e.target.value;
        console.log(ing);
        setIngredientList(ingredientList => [...ingredientList, ing]);
    }

    return(
        <div>
        <form>
            <input
            type="text"
            placeholder="type your ingredient"
            name="ingredientName"
            />
            <button onClick={createUserList}>Enter</button>
        </form>
        <ul>
            {ingredientList.map(ing => <li key={ing}>{ing}</li>)}
        </ul>
        </div>

    );
}

export default setUserIngredient;
